import './ImageMin.css'
function ImageMin(props) {

    const anchorClick = (e) => {
        e.preventDefault();
    }

    return (

        <div className="post-card">
            <div onClick={()=>anchorClick}>
                <h3>This is image title</h3>
                <img className = "post-card-img"src={props.url} />
                <button className='btn btn-primary m-3'>Like</button>
                <button className='btn btn-danger m-3'>Delete</button>
                <h6>Source: Name</h6>
                <h6>Location: Area51</h6>
            </div>
        </div>
    )
}
export default ImageMin;
